import React from "react";
import PropTypes from "prop-types";
const AppLayout = ({ children }) => {
  return (
    <div>
      <div>공통메뉴</div>
      {children}
    </div>
  );
};
AppLayout.propTypes = {
  //타입스크립트 사용시 propTypes 필요없음
  //리액트의 node이다
  //화면에 그릴 수 있는 모든 것들이 node.
  children: PropTypes.node.isRequired,
};

export default AppLayout;
